from PyQt5 import QtCore, QtGui, QtWidgets
from PyQt5.QtGui import QFont, QIcon
import psutil as ps
import re
import sys
import time

class WinService:
    def getService():
        try:
            service = list(ps.win_service_iter())
        except Exception as ex:
            print(str(ex))
        return service

class Ui_Form():
    def __init__(self,Form):
        self.services = None
        ## Add the mainimize and maximize buttons ##
        Form.setWindowFlag(QtCore.Qt.WindowMinimizeButtonHint, True)
        Form.setWindowFlag(QtCore.Qt.WindowMaximizeButtonHint, True)

    ## Return the QIcon from base64 Icon ##
    def getIcon(self,ImgB64):
        # Create Icon from base64 image (to put into 'Compliant' column) ##
        ## You can comment out the following 6 lines if you just use 'Yes'/'No' and background color in 'Compliant' column ##
        pixmap = QtGui.QPixmap()
        pixmap.loadFromData(QtCore.QByteArray.fromBase64(ImgB64))
        self.Icon = QtGui.QIcon(pixmap)
        return self.Icon

    def getTableWidgetIcon(self,ImgB64,CompliantStr):
        Icon = self.getIcon(ImgB64)
        self.itemIcon = QtWidgets.QTableWidgetItem(Icon,CompliantStr)
        return self.itemIcon

