    ## The service number count is displayed in the lower status bar ##
    def AddServiceCountStatus(self):
        self.labelServiceCountStatus = QtWidgets.QLabel()
        self.labelServiceCountStatus.setObjectName("LabelServiceStatus")
        self.verticalLayoutInputSection.addWidget(self.labelServiceCountStatus)   
    

    ## Add Rows under header (once the button is clicked) ##
    def AddRowItems(self):
        self.tableWidget.setSortingEnabled(False)       ## Disable the column just before adding the rows, to get the correct format ##
        resultFilteredwithServiceName = []
        resultFilteredwithServiceName_Status_StartupType = []
        inputstring = self.lineEdit_ServiceName.text().lower()  ## Get the input value of service name ##
        if self.services == None:
            self.services = WinService.getService()
        ## Iterate each service's name/display name and check if inputstring is matched ##
        for service in self.services:
            if (inputstring in service.display_name().lower()) or (inputstring in service.name().lower()):
                resultFilteredwithServiceName.append(service)
        
        ## Filter the previous result with Service Status and Startup Type##
        Status = self.comboBox_ServiceStatus.currentText().lower()
        StartupType = self.comboBox_ServiceStartupType.currentText().lower()
        for service in resultFilteredwithServiceName:
            if (((Status in service.status())  or (Status == 'all')) and ((StartupType in service.start_type()) or (StartupType == 'all'))):
                resultFilteredwithServiceName_Status_StartupType.append(service)

        ## Set the number of rows after getting the filter result ##
        self.tableWidget.setRowCount(len(resultFilteredwithServiceName_Status_StartupType))

        ## Update the service number count in Label status ##
        self.labelServiceCountStatus.setText(f"Number of services: {len(resultFilteredwithServiceName_Status_StartupType)}")

        ## Only display the matched service names ##
        i = 0
        for s in resultFilteredwithServiceName_Status_StartupType:
            if resultFilteredwithServiceName_Status_StartupType:
                self.tableWidget.setItem(i, 0, QtWidgets.QTableWidgetItem(s.name()))
                self.tableWidget.setItem(i, 1, QtWidgets.QTableWidgetItem(s.display_name()))
                self.tableWidget.setItem(i, 2, QtWidgets.QTableWidgetItem(s.status()))
                self.tableWidget.setItem(i, 3, QtWidgets.QTableWidgetItem(s.binpath()))
                self.tableWidget.setItem(i, 4, QtWidgets.QTableWidgetItem(s.start_type()))

                ## If the startup type is automatic & service is stopped, then uncompliant ##
                if ((s.start_type().lower() == 'automatic') and (s.status().lower() == 'stopped')):
                    IconB64Warning = b''
                    itemIcon = self.getTableWidgetIcon(IconB64Warning,"No")
                    self.tableWidget.setItem(i, 5, QtWidgets.QTableWidgetItem(itemIcon))

                ## If the startup type is automatic & service is running <or> disabled and stopped then compliant ##
                elif (((s.start_type().lower() == 'automatic') and (s.status().lower() == 'running')) or ((s.start_type().lower() == 'disabled') and (s.status().lower() == 'stopped'))) :
                    IconB64OK = b''
                    itemIcon = self.getTableWidgetIcon(IconB64OK,"Yes")
                    self.tableWidget.setItem(i, 5, QtWidgets.QTableWidgetItem(itemIcon))
                
                ## If the startup type is manual, we have no clues ##
                else:
                    self.tableWidget.setItem(i, 5, QtWidgets.QTableWidgetItem("N/A"))
                
                self.tableWidget.setItem(i, 6, QtWidgets.QTableWidgetItem(s.description()))
                i += 1 
       
        self.tableWidget.setSortingEnabled(True)

